import React from 'react';
import { BrowserRouter as Router, Route, Switch, Link } from 'react-router-dom';
import './App.css';
import ProjectPage from './components/ProjectPage'; // Page to view project details
import HomePage from './components/HomePage'; // Home page to list projects

function App() {
  return (
    <Router>
      <div className="App">
        <nav>
          <ul>
            <li>
              <Link to="/">Home</Link> {/* Link to Home page */}
            </li>
          </ul>
        </nav>

        <Switch>
          <Route path="/" exact component={HomePage} /> {/* Home page route */}
          <Route path="/project/:id" component={ProjectPage} /> {/* Dynamic route for project details */}
        </Switch>
      </div>
    </Router>
  );
}

export default App;
